INSERT INTO `projeto` (`codigo`, `titulo`, `descricao`, `prioridade`, `data_inicio`, `data_prazo`, `data_fim`, `criado_por`, `codigo_status`) VALUES
(1, 'Projeto Básico - Sistema de Monitoramento', 'Este projeto traduz novos requisitos de serviços mapeados pela Secretaria de Comunicação e busca implantar uma dina?mica de gesta?o de dados, informac?o?es, noti?cias e conteu?dos de imprensa e mi?dias sociais sobre o Governo do Estado do Pará que auxiliara?o a tomada de deciso?es estrate?gicas, at', 1, '2016-02-18', '2016-02-29', NULL, 0, 1),
(2, 'Demandas', 'Neste projeto devem ser colocadas as demandas rápidas do mês.', 2, '2016-02-01', '2016-12-31', NULL, 0, 1),
(5, 'Feira do Livro', 'Este projeto deve englobar as atividades relacionadas a Feira do Livro 2016', 3, '2016-02-18', '2016-04-30', NULL, 6, 1),
(6, 'Dia Mundial da Água', 'Criar campanha do dia Mundial da Água', 2, '2016-02-18', '2016-03-10', NULL, 0, 1),
(7, 'Aplicativo Agência ', 'Desenvolvimento de aplicativo para o Agência Pará. ', 3, '2016-02-19', '2016-02-29', NULL, 0, 1),
(8, 'Retrospectiva 2015', '<p>Desenvolver o site para apresentar as 40 hist&oacute;rias mais emocionantes relacionadas com o Governo do Estado do Par&aacute; no ano de 2015.</p>', 3, '2016-01-01', '2016-03-18', NULL, 0, 1),
(9, 'Topo do Portal PA', 'Topos do Portal PA devem ser atualizados.', 1, '2016-02-23', '2016-02-23', NULL, 0, 1),
(13, 'Campanha Mensagem do Governo na Alepa ', 'Desenvolver campanha para as redes sociais do Governo com base na "Mensagem do Governo à Alepa 2016". ', 2, '2016-02-23', '2016-03-31', NULL, 0, 1),
(15, 'Nova Identidade Redes do Governo', 'Desenvolvimento da nova identidade visual das redes sociais do Governo do Pará. ', 3, '2016-02-15', '2016-02-29', NULL, 0, 1),
(16, 'Vídeo tutorial #meubempara ', 'Desenvolver vídeo tutorial ensinando ao usuário como participar. ', 2, '2016-02-23', '2016-03-01', NULL, 0, 1),
(17, 'Vídeos Detran ', 'Desenvolvimento de uma série de vídeos com situações cotidianas do trânsito identificando erros e acertos. ', 2, '2016-02-15', '2016-03-04', NULL, 0, 1),
(18, 'Campanha Aedes Aegypti ', 'Desenvolvimento de campanha digital contra o mosquito Aedes Aegypti ', 3, '2016-02-12', '2016-03-25', NULL, 0, 2),
(19, 'Campanha Especial Mensal - Ambulatório LGBT', '<p>Desenvolver campanha para redes sociais do Governo.</p>', 2, '2016-02-19', '2016-02-27', NULL, 0, 0),
(20, 'Campanha Mês da Mulher ', '<p>Desenvolver campanha para as redes sociais em comemora&ccedil;&atilde;o ao Dia da Mulher.</p>', 3, '2016-02-22', '2016-03-07', NULL, 0, 1),
(21, 'Campanha do Oscar Hemopa', '<p>Na verdade &eacute; apenas uma pe&ccedil;a que o <strong>Hemopa</strong> ir&aacute; disparar no domingo no momento do Oscar</p>', 1, '2016-02-24', '2016-02-26', NULL, 0, 1),
(22, 'Vídeo Igeprev ', 'Desenvolver um vídeo tutorial com passo a passo do acesso à Cédula C.', 2, '2016-02-25', '2016-03-03', NULL, 15, 1),
(23, 'Banners site NAC ', '<p>A Assessoria do NAC solicitou 3 banner para serem colocados no site deles. 2 S&atilde;o do PA mas precisam ser modificados 1 Para ser criado</p>', 2, '2016-02-24', '2016-02-26', NULL, 0, 1),
(24, 'Campanha da Água', '---', 2, '2016-02-22', '2016-03-30', NULL, 15, 1),
(25, 'Publicom', '<p>Encontro de Comunica&ccedil;&atilde;o P&uacute;blica do Par&aacute; que ser&aacute; realizado nos dias 4, 5 e 6 de Maio, na Esta&ccedil;&atilde;o das Docas.</p>', 3, '2016-02-29', '2016-05-13', NULL, 0, 1),
(26, 'Relatório EGPA', '<p>Produzir relat&oacute;rio de visita &agrave; EGPA.</p>', 3, '2016-02-29', '2016-03-01', NULL, 0, 0),
(27, 'Teste Luiza', '<p>Teste Luiza</p>', 2, '2016-03-01', '2016-03-30', NULL, 0, 0),
(28, 'Imãs de brinde  ', '<p>A Secretaria vai entregar uma carta para as reda&ccedil;&otilde;es apresentando o novo Ag&ecirc;ncia, PA e redes do Governo, junto &agrave; carta ir&atilde;o dois im&atilde;s com fotografias do Par&aacute;.</p>', 2, '2016-03-03', '2016-03-07', NULL, 0, 1),
(29, 'Identidade Visual - Materiais Internos ', '<p>Definir identidade visual para documentos e outros materiais internos da Secretaria.&nbsp;</p>', 3, '2016-03-07', '2016-03-30', NULL, 0, 1),
(30, 'Materiais Pro Paz ', '<p>Desenvolver m&aacute;scaras e banners de apresenta&ccedil;&atilde;o do Pro Paz e seus projetos.</p>', 3, '2016-03-07', '2016-03-18', NULL, 15, 2),
(31, 'Capa SEMA', '<p>Produzir capa e avatar para fanpage da SEMA</p>', 2, '2016-03-10', '2016-03-11', NULL, 15, 2),
(32, 'Relatório de Fevereiro ', '<p>Produzir relat&oacute;rio de atividades da DCI do m&ecirc;s de fevereiro.</p>', 2, '2016-03-14', '2016-03-18', NULL, 15, 0),
(33, 'Pauta - TV Agência', '<p>Esse projeto ser&aacute; para incluir todas as demandas vinculadas &agrave; TV Ag&ecirc;ncia. Pautas, entrevistas ou mat&eacute;rias especiais.&nbsp;</p>', 2, '2016-03-14', '2016-03-31', NULL, 0, 1),
(34, 'DCI Visita', '<p>Incurs&atilde;o realizada pela DCI para fazer um diagn&oacute;stico da comunica&ccedil;&atilde;o digital do Governo do Par&aacute; a partir dos &oacute;rg&atilde;os e das diversas assessorias presentes na web. A visita inclui reuni&otilde;es semanais com os assessores das secretarias do governo q', 2, '2016-01-01', '2016-12-31', NULL, 0, 1),
(35, 'Apresentação Nardin', '<p>Apresenta&ccedil;&atilde;o do Secretario para divulga&ccedil;&atilde;o do novo workflow da SECOM.</p>', 3, '2016-03-11', '2016-03-17', NULL, 4, 1),
(36, 'Homologação dos sites Prodepa', '<p>Avalia&ccedil;&atilde;o e cr&iacute;tica dos sites desenvolvidos pela Prodepa com novo padr&atilde;o do Governo do Estado.</p>', 3, '2016-03-15', '2016-03-17', NULL, 4, 1),
(37, 'Campanha Trânsito', '<p>Campanha para a divulga&ccedil;&atilde;o em redes social com dicas sobre tr&acirc;nsito para conscientiza&ccedil;&atilde;o da popula&ccedil;&atilde;o Junto com o Detran</p>\r\n<p>A proposta da campanha &eacute; criar uma s&eacute;rie de v&iacute;deos com apoio do Detran.</p>\r\n<p>&nbsp;</p>', 1, '2016-03-16', '2016-04-30', NULL, 4, 1),
(38, 'Teste Nova Versão do Demandou', '<p>Ol&aacute;, a nova vers&atilde;o do demandou j&aacute; est&aacute; dispon&iacute;vel para aprecia&ccedil;&atilde;o. Quem puder, da uma <em>testadinha</em>&nbsp;l&aacute; e qualquer problema, &eacute; s&oacute; avisar.&nbsp;</p>\r\n<p>Novidades da vers&atilde;o 1.2:</p>\r\n<p>- Notifica&ccedil;&otilde;es por e-mail na cria&ccedil;&atilde;o dos projetos<br />- Tarefas agora podem ser visualizadas fora dos projetos, aba Tarefas no menu superior<br />- Pesquisa e organiza&ccedil;&atilde;o</p>', 1, '2016-03-16', '2016-03-17', NULL, 0, 0),
(39, 'TESTE', '<p>TESTE</p>', 3, '2016-03-17', '2016-03-25', NULL, 5, 0),
(40, 'Campanha Aniversário 145 Biblioteca Arthur Vianna', '<p>Divulga&ccedil;&atilde;o do&nbsp;Campanha Anivers&aacute;rio 145 Biblioteca Arthur Vianna, com propaga&ccedil;&atilde;o de banners para redes sociais, com dados hist&oacute;ricos, estat&iacute;sticas e programa&ccedil;&atilde;o.&nbsp;</p>\r\n<p>&nbsp;</p>', 2, '2016-03-17', '2016-03-27', NULL, 4, 2),
(41, 'Relatório de Fevereiro ', '<p>Produzir relat&oacute;rio de a&ccedil;&otilde;es da DCI referente ao m&ecirc;s de fevereiro.</p>', 2, '2016-03-14', '2016-03-17', NULL, 15, 1),
(42, 'Aniversário Municípios Verdes ', '<p>Produ&ccedil;&atilde;o de banner para o anivers&aacute;rio do Programa Munic&iacute;pios Verdes. Solicitado pela assessora Natalia Mello.&nbsp;</p>', 2, '2016-03-18', '2016-03-22', NULL, 0, 2),
(43, 'Materiais Internos ', '<p>Produ&ccedil;&atilde;o de identidade visual para alguns materiais de expediente da Secom.</p>', 3, '2016-03-21', '2016-03-25', NULL, 15, 1),
(44, 'Máscaras  Sedeme - ', '<p>Bom dia,&nbsp;</p>\r\n<p>Ap&oacute;s visita &agrave; Sedeme,&nbsp;fizemos o levantamento de produtos que eles devem utilizar nas redes sociais. Primeiramente envio as m&aacute;scaras de rotina, s&atilde;o elas</p>\r\n<ul>\r\n<li>Destaque de Not&iacute;cia</li>\r\n<li>Ao Vivo</li>\r\n<li>Clipping</li>\r\n<li>Pauta</li>\r\n<li>Selo para fotos</li>\r\n<li>Nota</li>\r\n<li>Aspas</li>\r\n</ul>\r\n<p><strong>Favor produzir o PSD e o PNG, pois eles tem algumas dificuldades com software ent&atilde;o enviaremos duas alternativas para que eles utilizem.</strong></p>\r\n<ul>\r\n<li>Avatar para facebook - padr&atilde;o</li>\r\n<li>Template de Capa de Facebook<br /><br /><br /></li>\r\n</ul>', 2, '2016-03-22', '2016-03-28', NULL, 0, 1),
(45, 'Capa fanpage CredCidadão ', '<p>Produzir capa padr&atilde;o para fanpage do Credcidad&atilde;o.&nbsp;</p>', 2, '2016-03-22', '2016-03-23', NULL, 15, 2),
(46, 'Materiais de Rotina - COHAB', '<p>Produzir materiais gr&aacute;ficos para serem utilizados na rotina das redes sociais da COHAB.&nbsp;</p>', 2, '2016-03-22', '2016-03-23', NULL, 15, 2),
(47, 'Vídeo Animação 5000 Likes Secom – Roteiro', '<p>Produ&ccedil;&atilde;o de v&iacute;deo anima&ccedil;&atilde;o em comemora&ccedil;&atilde;o aos mais de 5000 likes na fan page da Secom.</p>\r\n<p>&nbsp;</p>', 2, '2016-03-22', '2016-03-23', NULL, 0, 1),
(48, 'Novo Layout TOP 6', '<p>Bom dia<br /><br />Precisamos de um novo layout para o top 6, agora tamb&eacute;m deve conter um espa&ccedil;o para 6 links mais acessados do Ag&ecirc;ncia Par&aacute;. Neste caso, no layout deve aparecer apenas&nbsp;o nome da mat&eacute;ria, n&uacute;mero de acessos e o numero de cliques das redes sociais.</p>\r\n<p>Ex:</p>\r\n<p>1 Multinacional francesa vai investir mais de R$1 bilh&atilde;o no estado do Par&aacute;<br />Alcance: 3.419<br />Alcance de Redes Sociais: 3000</p>\r\n<p>2 Feira do Pescado em Bel&eacute;m &eacute; op&ccedil;&atilde;o de pre&ccedil;o e qualidade na Semana Santa<br />Alcance: 363<br />Alcance de Redes Sociais: 300</p>\r\n<p>3 Jatene analisa crise pol&iacute;tica e econ&ocirc;mica do Brasil em entrevista ao jornal Valor Econ&ocirc;mico<br />Alcance: 258<br />Alcance de Redes Sociais: 250</p>\r\n<p>4 Santa Casa registra redu&ccedil;&atilde;o na mortalidade de m&atilde;es e beb&ecirc;s<br />Alcance: 184<br />Alcance de Redes Sociais: 184</p>\r\n<p>5 Opera&ccedil;&atilde;o Semana Santa re&uacute;ne 3 mil agentes de seguran&ccedil;a no feriado<br />Alcance: 180<br />Alcance de Redes Sociais: 100</p>', 2, '2016-03-28', '2016-04-01', NULL, 9, 1),
(49, 'Atualização Campanha Hemocentros - Hemopa', '<p>Temos esta campanha antiga que produzimos para o Hemopa sobre os endere&ccedil;os de coleta em v&aacute;rios munic&iacute;pios. Precisamos&nbsp;mudar o layout, que est&aacute; com tema junino.<br />Favor criar um banner com um endere&ccedil;o novo, que n&atilde;o existia na &eacute;poca da primeira vez que esta campanha foi feita.<br /><br /><strong>Unidade de Coleta do Castanheira, no t&eacute;rreo da passarela P&oacute;rtico Metr&oacute;pole, na Br 316, Km 01</strong><br /><strong>Hor&aacute;rio de funcionamento igual da sede do Hemopa, em Bel&eacute;m.</strong><br /><br />Link da campanha original:&nbsp;<a href="https://www.facebook.com/media/set/?set=a.543405625721915.1073741849.175164055879409&amp;type=3" target="_blank">https://www.facebook.com/<wbr />media/set/?set=a.<wbr />543405625721915.1073741849.<wbr />175164055879409&amp;type=3</a></p>', 2, '2016-03-31', '2016-04-08', NULL, 9, 1),
(50, 'Listas Turísticas - Abril', '<p>Precisamos de 4 Listas Tur&iacute;sticas para serem postadas na fanpage do governo em Abril.<br />Postagem: Toda Segunda-feira</p>', 3, '2016-03-31', '2016-04-06', NULL, 0, 1),
(51, 'Destino da Semana - Abril', '<p>O produto listas tur&iacute;sticas deve falar de 4 destinos, um por semana, portanto &eacute; necess&aacute;rio:</p>\r\n<ol>\r\n<li>Escolher os 4 destinos e escrever um texto para cada - Vin&iacute;cius</li>\r\n<li>Separar 4 fotos para a produ&ccedil;&atilde;o do gif - Vin&iacute;cius</li>\r\n<li>Produ&ccedil;&atilde;o do gif pela cria&ccedil;&atilde;o - Jo&atilde;o</li>\r\n<li>Postagem pelo solicitante - &Iacute;talo</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>A postagem ser&aacute; feita toda sexta-feira, encerrando a semana.</p>', 2, '2016-04-01', '2016-04-06', NULL, 9, 1),
(52, 'Campanha "Museus do Pará"', '<p>Museu do C&iacute;rio<br />&ldquo;Visita mediada &agrave; instala&ccedil;&atilde;o tem&aacute;tica &lsquo;A Festa da Chiquita&rsquo;&rdquo;<br />Data:&nbsp;1&ordm; e 30 de abril<br />Hor&aacute;rio: 10h &agrave;s 15h<br />Entrada Franca</p>\r\n<p>Museu do Forte do Pres&eacute;pio;<br />"Oficina da t&eacute;cnica de pirogravura"<br />Per&iacute;odo: 1&ordm; e 30<br />Hor&aacute;rio: 10h &agrave;s 15h<br />Entrada Franca<br /><br />Centro Cultural Casa das Onze Janelas<br />A&ccedil;&atilde;o Educativa: Fotografia<br />Per&iacute;odo:&nbsp;19 e 24<br />Hor&aacute;rio: 10h &agrave;s 12h<br />Entrada Franca<br /><br />Museu do Estado do Par&aacute;<br />"Oficina de grafismo ind&iacute;gena"<br />Per&iacute;odo:&nbsp;20 e 27<br />Hor&aacute;rio: 13h30 &agrave;s 15h<br />Entrada Franca<br /><br />Museu de Arte Sacra<br />"Oficina de grafismo em cuia"<br />Data: 28/04/16<br />Hor&aacute;rio: 10h &agrave;s 12h<br />Entrada Franca</p>', 2, '2016-04-01', '2016-04-08', NULL, 9, 1);
