(30, 'Banner - Oscar Hemopa', 'O Hemopa quer disponibilizar um banner da seguinte forma: \r\n\r\n"A ideia seria a de uma pessoa doando sangue e erguendo uma estatueta do Oscar, com a frase ''''E o Oscar de solidariedade vai para... O doador de sangue!''''."\r\n\r\n ', 1, '2016-02-24', '2016-02-26', '2016-02-29', NULL, NULL, 6, 21, 7, 1),
