(71, 'Alteração do Nardin', '<p>Altera&ccedil;&atilde;o na paresenta&ccedil;&atilde;o no documento matriz, o secretario pediu para alterar as cores e disponibilizar o powerpoint com telas em branco para inclus&atilde;o de novo conte&uacute;do.&nbsp;</p>\n<p>Em virtude da altera&ccedil;&atilde;o das cores a anima&ccedil;&atilde;o', 2, '2016-03-16', '2016-03-17', '2016-03-16', NULL, NULL, 4, 35, 4, 1),
(72, 'Vídeo 01 Campanha trânsito ', '<p>Cria&ccedil;&atilde;o do primeiro v&iacute;deo piloto com o tema N&atilde;o Feche o Cruzamento.</p>\n<p>Dura&ccedil;&atilde;o: 45"</p>\n<p>&nbsp;</p>', 1, '2016-03-16', '2016-04-30', '2016-03-16', NULL, NULL, 4, 37, 4, 1),
