(74, 'Animação para o Telão - Copa Verde', '<p>Produzir uma anima&ccedil;&atilde;o para passar no tel&atilde;o do Mangueir&atilde;o em dias de jogo da Copa Verde.</p>\n<p>O conte&uacute;do dessa anima&ccedil;&atilde;o s&atilde;o a&ccedil;&otilde;es em parceria da&nbsp;Seel, Sedeme, Seips, Funda&ccedil;&atilde;o Pro Paz e Ecocelpa.</p>', 2, '2016-03-16', '2016-03-17', '2016-03-17', NULL, NULL, 13, 2, 13, 1),
(75, 'Banner Cosanpa - exposição', '<p>Igor, a Cosanpa solicitou um banner para divulga&ccedil;&atilde;o de uma exposi&ccedil;&atilde;o que eles v&atilde;o realizar no shopping. Seguem as informa&ccedil;&otilde;es que devem entrar na arte.&nbsp;</p>\n<div>\n<div><strong>Cosanpa apresenta:</strong></div>\n<div><strong>exposi&ccedil;&atilde;o &ldquo;&Aacute;gua pra usar, n&atilde;o para desperdi&ccedil;ar&rdquo;</strong></div>\n<div>&nbsp;</div>\n<div><strong>20 a 26 de mar&ccedil;o</strong></div>\n<div><strong>Parque Shopping Bel&eacute;m</strong></div>\n<div><strong>10h &agrave;s 22h</strong></div>\n<div><strong>Entrada Franca</strong></div>\n</div>', 3, '2016-03-17', '2016-03-18', '2016-03-21', NULL, NULL, 14, 2, 4, 1),
(76, 'Redigir Relatório', '<p>Redigir relat&oacute;rio de a&ccedil;&otilde;es da DCI em fevereiro.</p>', 3, '2016-03-14', '2016-03-17', '2016-03-17', NULL, NULL, 15, 41, 15, 1),
(77, 'BANNER PROGRAMAÇÃO', '<div>20/03 &ndash; Espet&aacute;culo A Princesa Travessa, no Teatro Waldemar Henrique, &agrave;s 18h</div>\r\n<div>25/03 - Oficina de higieniza&ccedil;&atilde;o de acervo bibliogr&aacute;fico - de 8h as 12h e de 13h as 17h</div>\r\n<div>28/03 a 01/04 - Moderniza&ccedil;&atilde;o de Biblioteca Municipal - Goian&eacute;sia do Par&aacute;</div>\r\n<div>29/03 - Workshop Biblioteca Viva, no Cine L&iacute;bero Luxardo, &agrave;s 9h</div>\r\n<div>29/03 - Sarau A Noite &eacute; uma Palavra &ndash; Teatro Waldemar Henrique, &agrave;s 19h</div>\r\n<div>30/03 &ndash; Premia&ccedil;&atilde;o do Concurso de HQ - Hall da Biblioteca Arthur Vianna, 2&ordm; andar da FCP</div>', 3, '2016-03-17', '2016-03-18', '2016-03-21', 1, 9, 9, 40, 4, 2),
(78, 'BANNERS SERVIÇO', '<div>1BANNER</div>\n<div>Voc&ecirc; sabia?</div>\n<div>&nbsp;</div>\n<div>Todas as bibliotecas que integram o Sistema de Bibliotecas da FCP est&atilde;o aptas &agrave; fazerem o empr&eacute;stimo p&uacute;blico de livros.</div>\n<div>Biblioteca Arthur Vianna (Centur)</div>\n<div>Biblioteca Vicente Salles (Casa das Artes)</div>\n<div>Biblioteca Carmen Souza (Curro Velho)</div>\n<div>Biblioteca Paulo Mendes (Casa da Linguagem)</div>\n<div>&nbsp;</div>\n<div>2 BANNER</div>\n<div>Voc&ecirc; Sabia?</div>\n<div>&nbsp;</div>\n<div>[&Iacute;cone] Identidade</div>\n<div>[&Iacute;cone]&nbsp;CPF</div>\n<div>[&Iacute;cone]&nbsp;Comprovante de Resid&ecirc;ncia</div>', 2, '2016-03-17', '2016-03-21', '2016-03-22', 1, 9, 9, 40, 4, 2),
(79, 'BANNER DE ANIVERSÁRIO', '<div>Mais de 850 mil exemplares</div>\n<div>14 se&ccedil;&otilde;es de g&ecirc;neros liter&aacute;rios</div>\n<div>145 anos formando gera&ccedil;&otilde;es</div>\n<div>&nbsp;</div>\n<div>Parab&eacute;ns, Biblioteca Arthur Vianna</div>', 2, '2016-03-17', '2016-03-25', '2016-03-22', 1, 9, 9, 40, 4, 2),
(80, 'BANNERS MEME E SERVIÇOS', '<div>1 BANNER MEME</div>\n<div>Gente que prefere estudar no Centur</div>\n<div>[&iacute;cones de livros ou pessoas estudando]</div>\n<div>Feliz 145 anos, Biblioteca Arthur Vianna</div>\n<div>&nbsp;</div>\n<div>Legenda: A tranquilidade, o conforto e a riqueza do acervo completam 145 anos!</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>2&nbsp;BANNER SERVI&Ccedil;OS</div>\n<div>Teatros</div>\n<div>Brinquedoteca</div>\n<div>Biblioteca Infantil</div>\n<div>Infocentros</div>\n<div>Salas exposi&ccedil;&atilde;o</div>\n<div>Salas de ensaio</div>\n<div>Pra&ccedil;a p&uacute;blica</div>\n<div>&nbsp;</div>\n<div>Biblioteca Arthur Vianna, 145 anos formando gera&ccedil;&otilde;es.</div>', 2, '2016-03-17', '2016-03-23', '2016-03-22', 1, 9, 9, 40, 4, 2),
(81, 'Banner - Histórias que contam ', '<p>Banner para o <strong>FB, Portal PA e Ag. Par&aacute;</strong> com a marca do Hist&oacute;rias que contam 2015.&nbsp;</p>', 3, '2016-03-17', '2016-03-17', '2016-03-21', NULL, NULL, 14, 2, 4, 1),
(82, 'Pauta Sedap', '<p>Produ&ccedil;&atilde;o de v&iacute;deo para a pauta Entrega de equipamentos e ve&iacute;culos garante impulso &agrave; agricultura familiar em 23 munic&iacute;pios</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;- Captura de Imagens</p>\r\n<p>- Finaliza&ccedil;&atilde;o do v&iacute;deo</p>\r\n<p>- Postagem nas redes sociais</p>', 2, '2016-03-17', '2016-03-17', '2016-03-17', NULL, NULL, 13, 2, 13, 1),
(83, 'Postagem de vídeo ', '<p>Postagem do v&iacute;deo Hospital Metropolitano atende mais de 3 milh&otilde;es de pessoas em 10 anos nas redes do Governo</p>', 2, '2016-03-17', '2016-03-17', '2016-03-17', NULL, NULL, 13, 2, 13, 1),
(84, 'Trocar vídeo da Retrospectiva 2015', '<p>Trocar v&iacute;deo da restrospectiva 2015 Hospital Metropolitano atende mais de 3 milh&otilde;es de pessoas em 10 anos</p>', 2, '2016-03-17', '2016-03-17', '2016-03-17', NULL, NULL, 13, 2, 13, 1),
(85, 'Texto do Banner', '<p>Produ&ccedil;&atilde;o de texto para o banner.</p>', 2, '2016-03-18', '2016-03-18', '2016-03-22', 1, 15, 15, 42, 15, 2),
(87, 'Produção Gráfica', '<p>&nbsp;</p>\n<p>- Papel Timbrado;</p>\n<p>- Wallpaper (alguns modelos gen&eacute;ricos);</p>\n<p>- Cart&atilde;o de visita;</p>\n<p>- Assinatura de email;</p>\n<p>- Template para apresenta&ccedil;&otilde;es;</p>', 2, '2016-03-21', '2016-03-25', NULL, NULL, NULL, 15, 43, 4, 1),
(88, 'Lançamento Site Publicom', '<p>No dia <strong>04/01/2016</strong>, o site deve ser lan&ccedil;ado j&aacute; com informa&ccedil;&otilde;es oficiais. &nbsp;</p>', 3, '2016-03-21', '2016-04-01', NULL, NULL, NULL, 5, 25, 5, 1),
(89, 'Produção gráfica do banner ', '<p>Jo&atilde;o, segue o texto do banner:</p>\n<p>(veja se voc&ecirc; tem a logo do programa)</p>\n<p><br />Programa Munic&iacute;pios Verdes<br />5 anos <br />Combatendo o desmatamento e fortalecendo a produ&ccedil;&atilde;o rural sustent&aacute;vel no Par&aacute;. <br /><br />23 de mar&ccedil;o</p>', 3, '2016-03-21', '2016-03-22', '2016-03-21', 1, 15, 15, 42, 7, 2),
(90, 'Requisitos para Vitrine Virtual', '<p>Precisaremos para o <strong>Vitrine Virtual</strong>:</p>\n<ol>\n<li>Lista de todos as editoras com e-mail do respons&aacute;vel que ser&aacute; usado para cadastro no sistema</li>\n<li>Local&nbsp;dos estandes na Feira para que o mapa seja montado</li>\n<li>Cadastro dos livros por parte das editoras (Com login e senha enviados por n&oacute;s)</li>\n</ol>', 3, '2016-03-22', '2016-04-30', NULL, NULL, NULL, 5, 5, 9, 1),
(91, 'Produzir capa para Fanpage do CredCidadão ', '<p>Produzir capa padr&atilde;o para fanpage do Credcidad&atilde;o.&nbsp;<br /><br />CredCidad&atilde;o - Microcr&eacute;dito do Governo do Par&aacute;&nbsp;</p>', 2, '2016-03-22', '2016-03-23', '2016-03-22', 1, 15, 15, 45, 7, 2),
(92, 'Produção Gráfica', '<p>Produzir m&aacute;scaras:</p>\n<p>&nbsp;</p>\n<p>Destaque de not&iacute;cias;</p>\n<p>Nota;</p>\n<p>Pauta;</p>\n<p>Clipping;</p>\n<p>Aspas;</p>\n<p>Ao Vivo;</p>\n<p>Convoca&ccedil;&atilde;o (entrega, reuni&otilde;es, audi&ecirc;ncias p&uacute;blicas, etc.) - Pode ter s&oacute; a palavra CONVOCA&Ccedil;&Atilde;O e em baixo AUDI&Ecirc;NCIA P&Uacute;BLICA por exemplo, que d&aacute;i essa palavra eles v&atilde;o editando de acordo com a situa&ccedil;&atilde;o. E em baixo uma caixa de texto para as informa&ccedil;&otilde;es.</p>\n<p>Antes e depois - Exatamente isso, pra mostrar uma foto do antes e uma do depois das casas, podes pegar qualquer foto de exemplo que l&aacute; eles v&atilde;o entender.&nbsp;</p>\n<p>Tudo com assinatura do Cheque Moradia e Cohab.</p>\n<p>&nbsp;</p>', 2, '2016-03-22', '2016-03-23', '2016-03-23', 1, 15, 15, 46, 7, 2),
(93, 'Criação de roteiro para animação', '<p>- [in&iacute;cio] M&atilde;ozinha de Like no fundo da tela marcando 0 likes e mostrando o lettering:</p>\n<p>&ldquo;Cria&ccedil;&atilde;o da Fan Page Secom - Maio de 2015&rdquo;</p>\n<p>- M&atilde;ozinha inicia subida e para em 500 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656697./793971860716961/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656697./793971860716961/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha continua a subida e para em 1.000 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656661./809111595869654/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656661./809111595869654/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha continua a subida e para em 2.000 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656661./824242331023247/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656661./824242331023247/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha continua a subida e para em 3.000 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656656./843781202402693/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656656./843781202402693/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha continua a subida e para em 4.000 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656654./871878076259672/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656654./871878076259672/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha co