ida e para em 4.500 likes, entrando print da postagem: <a href="https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656642./923907614390051/?type=3&amp;theater">https://www.facebook.com/secompara/photos/pb.761554317292049.-2207520000.1458656642./923907614390051/?type=3&amp;theater</a></p>\n<p>- M&atilde;ozinha continua a subida e chega em 5.000 likes com explos&otilde;es de fogos e o lettering: <br /> &ldquo;Obrigado pelas mais de CINCO MIL curtidas&rdquo;</p>', 2, '2016-03-22', '2016-03-23', NULL, NULL, NULL, 8, 47, 13, 1),
(95, 'BLOCO DE NOTAS', '<p>Cria&ccedil;&atilde;o do Bloco de Notas para impress&atilde;o.</p>\n<p>&nbsp;</p>', 3, '2016-03-28', '2016-03-29', '2016-03-28', NULL, NULL, 4, 25, 4, 1),
(96, 'Banner Dia do Diagramador e Revisor Jornalista', '<p>Cria&ccedil;&atilde;o de Banner em comemora&ccedil;&atilde;o ao Dia do Diagramador e Revisor Jornalista.<br />Texto do Banner:</p>\n<p><strong>28 de mar&ccedil;o<br />Dia do Diagramador e Revisor Jornalista</strong></p>\n<p>Obs: a minha sugest&atilde;o na arte &eacute; que a palavra revisor venha em cima da palavra "redator" riscada, como se a pessoa tivesse errado o nome e corrigido. Riscado a palavra "redator" e colocando em cima a palavra certa, "revisor". Entenderam? Uma brincadeira com o fato do revisor corrigir os textos que chegam para eles. Se puder brincar com a diagrama&ccedil;&atilde;o na arte tamb&eacute;m ficaria bem legal. Qualquer d&uacute;vida &eacute; s&oacute; me falar. ;)</p>', 3, '2016-03-27', '2016-03-28', NULL, NULL, NULL, 8, 2, 8, 1),
(97, 'Layout TOP 6', '<p>Cria&ccedil;&atilde;o dos Layouts Top 6 Ag&ecirc;ncia e Top 6 Fanpage&nbsp;</p>', 3, '2016-03-31', '2016-04-01', '2016-03-31', NULL, NULL, 9, 48, 9, 1),
