(100, 'Listas Turísticas - Gif 01', '<p>Ap&oacute;s o envio dos textos do Petterson, devem ser criados os gifs de cada postagem.<br /><br /><br /></p>', 3, '2016-03-31', '2016-04-06', NULL, NULL, NULL, 0, 50, 7, 1),
(101, 'Listas Turísticas - Gifs 02 03 e 04', '<p>Ap&oacute;s o envio dos textos do Petterson, voc&ecirc; poder&aacute; iniciar a produ&ccedil;&atilde;o dos gifs restantes. Ser&atilde;o 1 a cada ter&ccedil;a-feira do m&ecirc;s.</p>', 3, '2016-03-31', '2016-04-06', NULL, NULL, NULL, 9, 50, 7, 1),
(102, 'Gifs 03 04 e 05', '<p>03 Centro Cultural Casa das Onze Janelas<br />A&ccedil;&atilde;o Educativa: Fotografia<br />Per&iacute;odo:&nbsp;19 e 24<br />Hor&aacute;rio: 10h &agrave;s 12h<br />Entrada Franca<br /><br />04 Museu do Estado do Par&aacute;<br />"Oficina de grafismo ind&iacute;gena"<br />Per&iacute;odo:&nbsp;20 e 27<br />Hor&aacute;rio: 13h30 &agrave;s 15h<br />Entrada Franca<br /><br />05 Museu de Arte Sacra<br />"Oficina de grafismo em cuia"<br />Data: 28/04/16<br />Hor&aacute;rio: 10h &agrave;s 12h<br />Entrada Franca</p>', 2, '2016-04-01', '2016-04-08', NULL, NULL, NULL, 9, 52, 7, 1),
(103, 'GIFs 01 e 02', '<p>01 Museu do C&iacute;rio<br />&ldquo;Visita mediada &agrave; instala&ccedil;&atilde;o tem&aacute;tica &lsquo;A Festa da Chiquita&rsquo;&rdquo;<br />Data:&nbsp;1&ordm; e 30 de abril<br />Hor&aacute;rio: 10h &agrave;s 15h<br />Entrada Franca</p>\n<p>02 Museu do Forte do Pres&eacute;pio;<br />"Oficina da t&eacute;cnica de pirogravura"<br />Per&iacute;odo: 1&ordm; e 30<br />Hor&aacute;rio: 10h &agrave;s 15h<br />Entrada Franca</p>', 2, '2016-04-01', '2016-04-05', NULL, NULL, NULL, 9, 52, 7, 1);
