(60, 'O site está fora do tamanho padrão, o contêiner principal dos elementos deve ter 740px.\nNa página de contato, sugere-se inserir um mapa com a localização do órgão, como nos contatos da secom.\nJá funciona bem em tamanhos menores, fiz um teste rápido e o conteúdo já redimensiona de acordo.', '2016-03-17', 1, NULL, 67, 5, '0000-00-00 00:00:00'),
(61, '', '2016-03-17', 3, 4, 43, 15, '0000-00-00 00:00:00'),
(62, 'O site está fora do tamanho padrão, o contêiner principal dos elementos deve ter 740px.\nJá funciona bem em tamanhos menores, fiz um teste rápido e o conteúdo  redimensiona de acordo.\nOs botões de secretarias no rodapé estão fora do padrão, não aparecem como lista e sim como botões que mostram/escondem conteúdo.\n', '2016-03-17', 1, NULL, 68, 5, '0000-00-00 00:00:00'),
